import React from "react";
import Netflix from "./Netflix";
import Amazon from "./Amazon";
const favs = "netflix";
const App = () => (
    <>
    <h1>hello bro</h1>
  {
    favs === "netflix" ? <Netflix /> : <Amazon />
  }
  </>
)

export default App;
